import React from 'react'
import { Box } from '@mui/material'

const ProfilePicture = () => {
    return (
        <Box sx={{ height: '180px', width: '100%', marginTop: '10px' }}>
            <Box sx={{ height: '100%', width: '90%', backgroundColor: '#9b59b6', borderRadius: '50%' }}>

            </Box>
        </Box>
    )
}

export default ProfilePicture
